var t=Ember.HTMLBars.template({id:"NRHLjzb8",block:'{"symbols":[],"statements":[[6,"section"],[7],[0,"\\n    "],[6,"h3"],[7],[0,"Overview"],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        zyLabs is a program assignment auto-grader, currently supporting Java, Python, C, C++, MATLAB"],[6,"sup"],[7],[0,""],[8],[0,", and Web Programming (HTML/CSS/JavaScript). Key features:\\n    "],[8],[0,"\\n    "],[6,"ul"],[9,"class","body-text"],[7],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Easy authoring."],[8],[0," Instructors/TAs create new assignments in just tens of minutes via a web interface -- no installations, scripting, or special expertise. Just create the specification for the student and list test cases. Some instructors create 50 or 100 assignments for a term, small and large.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Immediate feedback."],[8],[0," Students submit and get a score based on the test cases passed. They can re-submit for a better score. Immediate feedback can improve learning and reduce frustration.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Integrated."],[8],[0," zyLabs is a low-cost add-on to any zyBook, integrated into its chapters -- no extra logins, data transfers, etc.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Built-in coding window."],[8],[0," Students can code directly in the zyBook making the first few weeks of class, or even the entire term, super smooth. File uploads are also supported for Java, Python, C, and C++, supporting the use of an external IDE.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Cost savings."],[8],[0," Auto-grading saves instructors and departments time and money.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Examples."],[8],[0," zyBooks provides example labs at no extra cost. NEW (Jan 2019) for C, C++, Java, and Python: zyBooks provides \\"many small programs\\" for the first 6-7 chapters, shown useful in CS1 classes. See below.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Use standalone."],[8],[0," zyLabs can also be used standalone for classes using a different book or no book.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[1,[25,"zb-icon",null,[["icon","color"],["new_releases","orange"]]],false],[0," "],[6,"b"],[7],[0,"NEW (Jan 2019) for C, C++, Java, and Python: zyBooks-maintained labs."],[8],[0," By request,\\n            zyBooks now provides many examples in \\"zyBooks-maintained labs\\" (ZMLs) form. See below.\\n        "],[8],[0,"\\n    "],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        We like to call zyLabs \\"the easiest-to-use program auto-grader on the planet.\\"\\n    "],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        The zyLabs product is not intended for exams. See below.\\n    "],[8],[0,"\\n"],[8],[0,"\\n"],[6,"section"],[7],[0,"\\n    "],[6,"h3"],[7],[0,"Create your own or use our labs"],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        The price of zyLabs is for the auto-grading system. zyBooks provides example labs at no extra cost.\\n    "],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        "],[6,"b"],[7],[0,"One large program (OLP)."],[8],[0," Some labs are suitable for traditional one large program (OLP) weekly assignments, each consisting of the large program labeled with an asterisk (*) and \\"Program,\\" and some smaller warm-up labs labeled \\"Warm up.\\" Instructors should treat those as their own programs, being very familiar with each, and ready to answer questions that new learners have (learning programming is hard!).\\n    "],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        "],[1,[25,"zb-icon",null,[["icon","color"],["new_releases","orange"]]],false],[0," "],[6,"b"],[7],[0,"Many small programs (MSPs) (NEW Jan 2019 for Java, Python, C, and C++)."],[8],[0," We also provide many small programs (MSPs) for the first 6-7 chapters. MSPs are less intimidating, enabling students to get started more quickly and to pivot among MSPs when stuck (\\"self-help\\"). Research shows MSPs (enabled by auto-grading) lead to happier students and better performance in CS1 classes; see this "],[6,"a"],[9,"href","https://www.asee.org/public/conferences/106/papers/21762/view"],[9,"target","_blank"],[7],[0,"research paper"],[8],[0,". Analysis also shows MSPs CS1 students do fine in a later OLP CS2.\\n    "],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        "],[1,[25,"zb-icon",null,[["icon","color"],["new_releases","orange"]]],false],[0," "],[6,"b"],[7],[0,"zyBooks-maintained labs (ZMLs) (NEW Jan 2019 for Java, Python, C, and C++)."],[8],[0," By request, we now provide zyBooks-maintained labs (ZMLs) for CS1 (and some for CS2). Maintenance may include zyBooks improving labs each term, modifying/replacing some labs each term to reduce copying, and fixing errors on the fly. We also plan to add advanced techniques like automated hints. These labs have a \\"zyBooks maintained\\" label that only instructors see. You can use ZMLs directly or copy them so you can edit.\\n    "],[8],[0,"\\n"],[8],[0,"\\n"],[6,"section"],[7],[0,"\\n    "],[6,"h3"],[7],[0,"Advice"],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        Porting traditional programming assignments to zyLabs is OK, but our experience has taught us that auto-graded labs might be best used as follows:\\n    "],[8],[0,"\\n    "],[6,"ul"],[9,"class","body-text"],[7],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Avoid console I/O."],[8],[0," Instead, just create programs that read input data and print output data. Keep formatted output to a minimum. The auto-grading test cases will be more comprehensible to students.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Start straightforward."],[8],[0," Many instructors get excited by auto-grading options and go a little overboard (if we may say so). We recommend starting with straightforward initial assignments using simple test cases. You may find those give you most of the bang for the buck.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Use many small programs."],[8],[0," Auto-graders enable you to assign more labs, each shorter than traditional weekly labs, so students get more practice on a week\'s key concepts. Our company\'s professors create 5-7 labs per week -- 2 easy, 3 medium, and 2 hard, each requiring about 20-25 minutes on average. Students start earlier, gain confidence, and switch among labs if stuck.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Use zyBooks-maintained labs."],[8],[0," If you are teaching CS1 in Java, Python, C, or C++, considering using our ZMLs. They are widely tested, and we\'ll be continually improving them. Instead of focusing on creating labs, you can focus on helping students learn.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Use a grade threshold."],[8],[0," Immediate score feedback enables you to develop student-friendly grading policies. We make our 7 labs with 10 points each (a few points for each test case) and require only 50 points (of 70 possible) per week for full credit. Some instructors give extra credit for points beyond the threshold.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Select a subset."],[8],[0," If using our examples, instructors may need to choose a subset; the number of provided examples may be more than appropriate for one course. For Java/Python/C/C++, we recommend starting with our MSPs, requiring perhaps 5-7 per week.\\n        "],[8],[0,"\\n        "],[6,"li"],[7],[0,"\\n            "],[6,"b"],[7],[0,"Provide help resources."],[8],[0,"  Learning to program is hard. Students need help at all hours. We recommend you provide as much help as you can, like a forum (Piazza, Slack, GroupMe, etc.) for discussion with students/instructors, email, office hours, scheduled lab times, etc. If you\'d like to encourage us to provide teaching assistants, let us know! Contact your account executive or email "],[6,"a"],[9,"href","mailto:sales@zybooks.com"],[7],[0,"sales@zybooks.com"],[8],[0,".\\n        "],[8],[0,"\\n    "],[8],[0,"\\n"],[8],[0,"\\n"],[6,"section"],[7],[0,"\\n    "],[6,"h3"],[7],[0,"zyLabs is designed for assignments, not exams"],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        The zyLabs product is designed for homework and weekly programming assignments. It is not intended for exams like midterms, finals, and timed quizzes. Exam products have different product design requirements, different support requirements, and can impose an excessive load on our servers for larger classes. Thus, exam products often have a higher price and/or a separate cost.\\n    "],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        If you do wish to use zyLabs for exams, contact your account executive or "],[6,"a"],[9,"href","mailto:sales@zybooks.com"],[7],[0,"sales@zybooks.com"],[8],[0," to discuss. Note: Some early adopters are grandfathered in; if you are unsure, contact us. Some types of exams may not pose a problem, like exams taken by each student at individualized dates/times and with time windows tolerant of delays/retakes. For such cases, permission might be granted with no or only minor additional cost. Contact us to find out.\\n    "],[8],[0,"\\n    "],[6,"p"],[9,"class","body-text"],[7],[0,"\\n        We may consider developing an exam product; your input on such a product would be valuable.\\n    "],[8],[0,"\\n"],[8],[0,"\\n"]],"hasEval":false}',meta:{moduleName:"zybooks-web/components/modals/about-zybook/zylabs-about/template.hbs"}})
